INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5400101025837', 'Filets de cabillaud panés', 'Kabeljauwfilets gepaneerd, voorgebakken en gekoeld. Filets de cabillaud panés, précuits et réfrigérés. Ingrediënten: Kabeljauwfilet 65% (Gadus morhua ou Gadus macrocephalus), tarwemeel, plantaardige oliën (zonnebloem, koolzaad), water, zout, tarwegluten, gist. Kan sporen bevatten van ei, melk, weekdieren, selderij en soja. Ondanks alle zorg die wij aan dit product besteed hebben, kan er bij uitzondering nog een graatje in voorkomen. Oorsprong: Geproduceerd in Frankrijk. Gevangen met trawlnetten in het Noordelijke deel Atlantische Oceaan of Stille Oceaan (FAO 61/67/21/27/18). Bereiding: Goed verhitten tot in de kern voor consumptie. Uit de verpakking halen. Zonder vetstof toe te voegen: In de oven bij 180°C: bakken 8 tot 10 minuten en draai regelmatig om. In de pan, op een zacht vuurtje: bakken 3 tot 4 minuten per zijde. Bewaring: Te bewaren op max +4°C. Bewaart nog 3 dagen in koelkast, eens geopend. Verpakt onder beschermende atmosfeer. Ingrédients Filet de cabillaud 65% (Gadus morhua ou Gadus macrocephalus), farine de blé, huiles végétales (tournesol, colza), eau, sel, gluten de blé, levure. Peut contenir des traces d\'oeufs, de lait, de mollusque, de céleri et de soja. Bien qu\'un soin tout particulier ait été pris pour enlever toutes les arêtes, quelques-unes peuvent exceptionnellement se trouver dans ce produit. Origine Fabriqué en France. Pêché au chalut dans le nord de l\'océan Atlantique ou de l\'océan Pacifique (FAO 61/67/21/27/18). Utilisation Bien cuire à coeur avant consommation. Retirer l\'emballage. Sans ajout de matière grasse : Au four à 180°C: cuire 8 à 10 minutes et retourner régulièrement. A la poêle à feu moyen : cuire 3 à 4 minutes de chaque côté. Conservation :', 'https://static.openfoodfacts.org/images/products/540/010/102/5837/front_fr.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

