VALUES ('5400101032972', 'Cordon Bleu 3 Fromages', 'Viande de poulet 49%, viande de dinde : 8,4%, eau, Emmental 5.5%, huile de tournesol, farine de blé, fibres de blé, sel, Roquefort 1.5%, Comté 1%, dextrose, saccharose, arômes naturels, extrait de carotte, levure, épices, ferments, amidon modifié de maïs, antioxydant : ascorbate de sodium, émulsifiant : citrates de sodium, gélifiant : carraghénanes. Conseil de préparation : Au four traditionnel : Préchauffer vote lu inin à 2000C (thermostat 7/8). Placer les panés dans un plat, sans apportflo matière grasse. Faites les réchauffer 14 min. A la poêle : Fait% doux 5 min de chaque côté, sans ajouter de matière grasse. Conseil de conservation :', 'https://static.openfoodfacts.org/images/products/540/010/103/2972/front_fr.4.400.jpg', '13', '3.5', '12', '2.1', '1.8', '15', '1.2', '0.47244094488189', '', '0');

