INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5400101040335', 'Focaccia à l\'ail', 'Ontdooid product van de fijnbakkerij met knoflook. Ingrediënten: Tarwebloem, water, geraspte mozzarella (gepasteuriseerde koemelk, aardappelzetmeel, zout, melkfermenten, microbieel stremsel), bereiding met knoflook (boter, koolzaadolie, knoflook 0,35%, zout, peterselie, melkeiwit, tarwezetmeel), plantaardige oliën (zonnebloem, koolzaad, olijf), gist, zout, rijstbloem, suiker, conserveermiddel: natriumpropionaat, knoflook extract 0,1%, peterselie, koolzaadvet. Kan sporen bevatten van soja, eieren, sesamzaad, selderij, lupine en mosterd. Bereidingstip: In de traditionele oven: plastieken verpakking verwijderen. Opwarmen gedurende 8-10 minuten in een voorverwarmde oven van 180°C. Bewaring: Te bewaren op max +7°C. Eens geopend, onmiddellijk consumeren. Te gebruiken tot: zie verpakking NL V Décongelé produit de la boulangerie fine à l\'ail. Ingrédients Farine de blé, eau, mozzarella râpée (lait de vache pasteurisé, amidon de pommes de terre, sel, ferments lactiques, présure microbienne), préparation à l\'ail (beurre, huile de colza, ail 0,35%, sel, persil, protéine de lait, amidon de blé), huiles végétales (tournesol, colza, olive), levure, sel, farine de riz, sucre, conservateur : propionate de sodium, extrait d\'ail 0,1 %, persil, graisse de colza. Peut contenir des traces de soja, oeufs, graines de sésae céleri, lupin et moutarde. Conseil de préparation Au four traditionnel : enlever l\'emballage en piastique dufer pendant 8-10 minutes dans un four préchauffé à 180°C. Conservation : max 7°', 'https://static.openfoodfacts.org/images/products/540/010/104/0335/front_fr.3.400.jpg', '9.5', '4.2', '38', '1.7', '4.8', '8.2', '1.3', '0.511811023622047', '', '0');

