VALUES ('5400101040731', 'Croquettes au fromage', 'Eau, fromage fondu 15% (fromages, eau, protéines de lait, sel, amidon modifié de pommes de terre, épaississant: carraghénanes, sels de fonte : orthophosphates de sodium - polyphosphates citrates de so - dium, beurre, colorant: rocou), chapelure 9 % (farine de blé, levure, sel), margarine (huile de palme, huile de colza, huile de coco, huile de tournesol, eau, émulsifiant: mono-et diglycér - des d\'acides gras, acidifiant acide citrique), farine de blé, amidons (riz, blé, pois), arôme (arôme naturel de noix de muscade et arôme de fromage), lactosérum en poudre, lait écrémé en poudre, stabilisants: hydroxypropylméthylcellu - lose-carboxyméthylcellulose, extrait de levure, farine de riz, sel, épaississant gomme guar, correcteur d\'acidité: hydroxyde de calcium.', 'https://static.openfoodfacts.org/images/products/540/010/104/0731/front_fr.15.400.jpg', '11', '6.9', '18', '3.7', '0.9', '6.5', '1.5', '0.590551181102362', '', '0');

