VALUES ('5400101041455', 'Muesli de luxe', 'Flocons de céréales (_avoine_ complète, _blé_ complet, _orge_), raisins sultana secs (raisins sultana, huile végétale tournesol et coton), raisins secs (raisins, huile de tournesol), papaye séchée et sucrée (papaye, sucre de canne), lamelles de bananes rissolées (banane, huile de coco, sucre, arôme naturel de banane), lamelles de coco toastée, noisettes, morceaux de pommes sèches (pomme, acidifiant : acide citrique, antioxydant : disulfite de sodium), graines de tournesol, lamelles d\'_amandes_, lamelles de _noix_ du Brésil', 'https://static.openfoodfacts.org/images/products/540/010/104/1455/front_fr.7.400.jpg', '6.9', '2.4', '62', '20', '8.4', '9.5', '0.03', '0.0118110236220472', '', '1');

