VALUES ('5400101048553', 'Teriyaki boeuf aux légumes, saveur japonaise', 'Pâtes alimentaires cuites 36% (eau, farine de blé, oeufs, sel), légumes en proportion variable 16% (poivron, pousse de haricots mungo, carotte, pousses d\'ail), eau, viande de boeuf cuite 13% (viande de boeuf 12,7%, amidon de tapioca , sel, sucre), sauce soja 7% (eau , fèves de soia, blé, sel, vinaigre d\'alcool, alcool, sucre), châtaignes d\'eau, sucre 2 %, vermouth, huile de tournesol, amidon modifié de maïs, vinaigre de vin blanc, purée de gingembre, huile de sésame (graine de sésame), ail, extrait de viande de boeuf, sel, épice. Peut contenir des traces de crustacés, de lait, de céleri, de moutarde et d\'arachides.', 'https://static.openfoodfacts.org/images/products/540/010/104/8553/front_fr.4.400.jpg', '1.9', '0.4', '15', '3.4', '', '6.3', '0.9', '0.354330708661417', '', '1');

