VALUES ('5400101057364', 'VIANDE DES GRISONS', 'Viande de boeuf, sel, épices et cides : 0 g (waarvan suikers/dont sucres: 0 g) - extrait d\'épices (poivre, laurier, clou de girofle), al, Vezels/Fibres alimentaires: 0g-Eiwitten / Pro - genévrier moulue, sucre, conservateur: nitrate de potassium, correcteur d\'acidité: citrate de sodium, antioxydant ascorbate de sodium, ferments. Peut contenir des traces de lait, d\'oeufs, de soja, de moutarde et de fruits à coque. 200 g de viande de boeuf sont utilisés pour 100g de produit fini. Origine:Cette viande des grisons a été fabriqué lympiadenlaan, 1140 Evere en Suisse à partir de la viande de boeuf issue de lel: 0800/9.10.11. rUE. Conservation : A conserver entre 0°C et +4°C.', 'https://static.openfoodfacts.org/images/products/540/010/105/7364/front_fr.11.400.jpg', '4', '2.3', '0.6', '0.6', '', '40', '4.8', '1.88976377952756', '', '0');

