VALUES ('5400101057418', 'Gaufres de Liège avec Chocolat Noir', 'Farine de froment, margarine (huiles et graisses végétales (palme, colza; en proportions variables), eau, émulsifiants : lécithine de _soja_, mono- et diglycérides d\'acides gras, sel, acidifiant: acide citrique, arômes naturels, colorant : bêta-carotène), sucre 13 % (pâte de cacao, sucre, beurre de cacao, matières grasse _laitière_ anhydre, émulsifiants: lécithine de _soja_ - polyricinoléate de polyglycérol vanilline), levure, _œufs_, sirop de de sucre inverti, farine de _soja_, stabilisant : sirop de sorbitol, sel, émulsifiant : lécithine de _soja_, arôme.', 'https://static.openfoodfacts.org/images/products/540/010/105/7418/front_fr.4.400.jpg', '25', '14', '52', '30', '', '6', '0.75', '0.295275590551181', '', '0');

