INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5400101059641', 'Ravioli emmental basilic', 'Semoule de blé* dur de qualité supérieure 43%, eau, chapelure* (farine de blé*, sel), fromage* frais 8%, œufs* 6% (soit 140 g d\'oeufs par kg de semoule), rmta* 4,8%, emmental* 4%, basilic* 4%, huile de tournesol*, flocons de pomme de terre* (pomme de terre*, antioxydant : extraits de romarin), sel, fibre de son de blé*, arôme naturel (contient Et). *Ingrédient issu de l\'agriculture biologique. Peut contenir des traces de soja, fruits à coque et graines de sésame. Origine : Ces ravioli ont été fabriqués en France à partir de blé, d\'oeufs et de basilic provenant de l\'Union européenne. Les fromages sont fabriqués dans l\'Union européenne et en Suisse. Préparation : Plonger tes ravioli dans un grand volume d\'eau salée frémissante. Remuer et laisser cuire 5 minutes environ. Egoutter et servir avec une sauce de votre choix. Conservation :', 'https://static.openfoodfacts.org/images/products/540/010/105/9641/front_fr.4.400.jpg', '6.9', '2.7', '39.7', '2.3', '3', '9.3', '1.3', '0.511811023622047', '', '0');

