VALUES ('5400101067172', 'Velouté 5 légumes', 'Bio velouté met 5 groenten (32%). / Velouté aux 5 legumes (32 melk, selderi, erwtjes*, room* (bevat stabilisator: E407, maiszel bio.D Ingredienten: Water, uien*, spinazie&quot;, prei, aardappelen afkomstig uit de biologische landbouw. Bereidingstip: Micragol meel, peterselie, boter, zeezout, zwarte peper &quot;Ingrediënten Oven: open het potje en verwarm 2 min bij 750W. Pan: verwarm 3to 6 min. op een zacht vuur. Bewaring: Te bewaren op max +C Bewaart nog 48u in de koelkast eens geopend. Te gebruiken tot zie gecontroleerd door CERTISYS BE-BIO-01./EIngrédients Ea folie. Bereiding gecertificeerd door Certisys BE-BlO-01, verdeling oignons, épinards*, poireaux&quot;, pommes de terre * lait celen peis pois, creme (contient stabilisant : E407), amidon de mais persi beurre, sel marin, poivre noir*. *Ingrédients issus de lagricuiture biologique. Préparation : Micro-ondes : ouvrir le pot et réchaufer 2 min à 750N. Casserole : réchauffer pendant 3 à 6 min a feu doux Conservation :', 'https://static.openfoodfacts.org/images/products/540/010/106/7172/front_fr.19.400.jpg', '0.9', '0.5', '3.5', '1.1', '1', '0.9', '0.43', '0.169291338582677', '', '1');

